import React, { useState, useEffect } from 'react'
import '../../style/default.scss'

import { Card } from 'react-bootstrap'
import '../../style/member/member_card.scss'
import { MdCameraAlt } from 'react-icons/md'
import { devUrl } from '../../config'
import { withRouter, Link } from 'react-router-dom'
import MemberPhoto from '../../components/Member/MemberPhoto'
import Rating from '@material-ui/lab/Rating'
import Box from '@material-ui/core/Box'

const labels = {
  0.5: '0.5',
  1: '1.0',
  1.5: '1.5',
  2: '2.0',
  2.5: '2.5',
  3: '3.0',
  3.5: '3.5',
  4: '4.0',
  4.5: '4.5',
  5: '5.0',
}
function MemberCard(props) {
  const [member, setMember] = useState([])

  useEffect(() => {
    Axios.get(`http://localhost:3001/member/get/${props.match.params.id}`).then(
      (res) => {
        setMember(res.data)
      }
    )
  })
  return (
    <>
      {member.map((val) => {
        return (
          <div className="container ">
            <Card className="mem_card d-flex justify-content-start ">
              <MemberPhoto />

              <Card.Body>
                <Card.Text className="d-flex justify-content-center  align-items-center">
                  <div className="d-flex justify-content-center  ">
                    <div className=" d-flex justify-content-center">
                      <p className=" d-flex align-items-center star_Points">
                        <Box sml={2}>{val.member_Average_rating} </Box>
                      </p>
                      <Rating
                        name="read-only"
                        value={val.member_Average_rating}
                        readOnly
                      />
                    </div>
                  </div>
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
        )
      })}
    </>
  )
}

export default withRouter(MemberCard)
